namespace CourseApp.Tests.Module3
{
    using System;
    using System.IO;
    using Xunit;

    [Collection("Sequential")]
    public class FindSubstringTest : IDisposable
    {
        private const string Inp1 = @"ababbababa
aba";

        private const string Out1 = @"0 5 7 ";

        private const string Inp2 = @"asdflkjahsdlkfjhalkjhasodieoirqwe
so";

        private const string Out2 = @"22 ";

        private const string Inp3 = @"qwertyuioufadupasdfghjasgdfljhasdjfklzxcvbasdjfhkjnm
qwertyui";

        private const string Out3 = @"0 ";

        private const string Inp4 = @"asdqweafsdqwfsdsdqwaada
qw";

        private const string Out4 = @"3 10 17 ";

        private const string Inp5 = @" as iduf asdifo
 as";

        private const string Out5 = @"0 8 ";

        private const string Inp6 = @"qiweuriquwer
qwerty";

        private const string Out6 = @"";

        private const string Inp7 = @"
bbcccab";

        private const string Out7 = @"287 1585 3612 4294 10800 12025 20604 26894 ";

        public void Dispose()
        {
            var standardOut = new StreamWriter(Console.OpenStandardOutput());
            standardOut.AutoFlush = true;
            var standardIn = new StreamReader(Console.OpenStandardInput());
            Console.SetOut(standardOut);
            Console.SetIn(standardIn);
        }

        [Theory]
        [InlineData(Inp1, Out1)]
        [InlineData(Inp2, Out2)]
        [InlineData(Inp3, Out3)]
        [InlineData(Inp4, Out4)]
        [InlineData(Inp5, Out5)]
        [InlineData(Inp6, Out6)]
        [InlineData(Inp7, Out7)]
        public void Test1(string input, string expected)
        {
            var stringWriter = new StringWriter();
            Console.SetOut(stringWriter);

            var stringReader = new StringReader(input);
            Console.SetIn(stringReader);

            // act
            FindSubstring.FindSubstringMethod();

            // assert
            var output = stringWriter.ToString().Split(Environment.NewLine, StringSplitOptions.RemoveEmptyEntries);
            var result = string.Join(Environment.NewLine, output);

            Assert.Equal($"{expected}", result);
        }
    }
}